import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // --- Wait for the sort/filter controls to appear ---
    // The sort filter controls are rendered on search/category results, not on the homepage.
    // To get there, perform a search to trigger the controls.

    // Wait for the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Type a search term (e.g., "iphone")
    await page.fill('#searchInput', 'iphone');

    // Click the search button (first visible .search-btn)
    const searchBtn = await page.$('.search-btn');
    if (searchBtn) {
      await searchBtn.click();
    }

    // Wait for the sort/filter controls to appear
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });

    // Take screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_search.png'));

    // --- Apply Price Sort Filter: Sort by "Price: Low to High" ---

    // Wait for sort select to be visible
    await page.waitForSelector('#sortSelect', { timeout: 5000 });

    // Select "Price: Low to High"
    await page.selectOption('#sortSelect', 'price-low');

    // Wait for the products to update (sort notification appears)
    // Wait for notification to appear and disappear (max 4s)
    await page.waitForSelector('.notification.show', { timeout: 4000 });
    await page.waitForSelector('.notification.show', { state: 'detached', timeout: 4000 });

    // Take screenshot after sort
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_low_to_high.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_low_to_high.png'));

    // --- Extract product titles and prices to verify sort order ---
    // Wait for product cards to be visible
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Extract the first 5 product titles and prices
    const products = await page.$$eval('.product-card', cards =>
      cards.slice(0, 5).map(card => {
        const title = card.querySelector('.product-title')?.textContent?.trim() || '';
        const priceText = card.querySelector('.product-price')?.childNodes[0]?.textContent?.replace(/[^0-9.]/g, '') || '';
        const price = parseFloat(priceText);
        return { title, price };
      })
    );

    // Check if prices are sorted low to high
    let sorted = true;
    for (let i = 1; i < products.length; i++) {
      if (products[i].price < products[i - 1].price) {
        sorted = false;
        break;
      }
    }

    return {
      success: true,
      action: 'Applied Price Sort Filter: Price Low to High on search results',
      extractedData: {
        firstFiveProducts: products,
        isSortedLowToHigh: sorted
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
